column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli może przyjmować zarówno bezpośrednie dane konfiguracji JSON, jak i nazwę pliku zawierającego konfigurację. W tym drugim przypadku plik jest odczytywany, a jego zawartość jest umieszczana w tej właściwości.

Przykłady: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/mój-zespół.conf

Użycie: nmcli device reapply { PARAMETRY | help }

PARAMETRY := <nazwa interfejsu>

Próbuje zaktualizować urządzenie zmianami wprowadzonymi do obecnie aktywnego połączenia od ostatniego zastosowania zmian.

column1:
Usage: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modify device properties.

column3:
Użycie: nmcli device set { PARAMETRY | help }

PARAMETRY  := URZĄDZENIE { WŁAŚCIWOŚĆ [ WŁAŚCIWOŚĆ … ] }
URZĄDZENIE := [ifname] <nazwa interfejsu> 
WŁAŚCIWOŚĆ := { autoconnect { yes | no } |
              { managed { yes | no }

Modyfikuje właściwości urządzenia.

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
Użycie: nmcli general { POLECENIE | help }

POLECENIE := { status | hostname | permissions | logging }

  status

  hostname [<nazwa komputera>]

  permissions

  logging [level <poziom dziennika>] [domains <domeny dziennika>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
Użycie: nmcli general status { help }

Wyświetla ogólny stan usługi NetworkManager.
„status” jest domyślnym działaniem, co oznacza, że „nmcli gen” wywołuje „nmcli gen status”

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
Użycie: nmcli networking { POLECENIE | help }

POLECENIE := { on | off | connectivity }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
Użycie: nmcli radio { POLECENIE | help }

POLECENIE := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
Użycie: nmcli radio all { PARAMETRY | help }

PARAMETRY := [on | off]

Uzyskuje stan wszystkich przełączników radia lub włącza/wyłącza je.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
Użycie: nmcli radio wifi { PARAMETRY | help }

PARAMETRY := [on | off]

Uzyskuje stan przełącznika radia Wi-Fi lub włącza/wyłącza go.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
Użycie: nmcli radio wwan { PARAMETRY | help }

PARAMETRY := [on | off]

Uzyskuje stan przełącznika radia komórkowego lub włącza/wyłącza go.
